  \ example, [1, 2, 3] and [4, 3, 5, 1, 2] are permutations, but [1, 2, 4] and [4,\
  \ 3, 2, 1, 2] are not permutations. You should perform q queries.\n\nThere are two\
  \ types of queries:\n\n  * 1 x y \u2014 swap p_x and p_y. \n  * 2 i k \u2014 print\
  \ the number that i will become if we assign i = p_i k times. \n\nInput\n\nThe first\
  \ line contains two integers n and q (1 \u2264 n, q \u2264 10^5).\n\nThe second\
  \ line contains n integers p_1, p_2, ..., p_n.\n\nEach of the next q lines contains\
  \ three integers. The first integer is t (1 \u2264 t \u2264 2) \u2014 type of query.\
  \ If t = 1, then the next two integers are x and y (1 \u2264 x, y \u2264 n; x \u2260\
  \ y) \u2014 first-type query. If t = 2, then the next two integers are i and k (1\
  \ \u2264 i, k \u2264 n) \u2014 second-type query.\n\nIt is guaranteed that there\
  \ is at least one second-type query.\n\nOutput\n\nFor every second-type query, print\
  \ one integer in a new line \u2014 answer to this query.\n\nExamples\n\nInput\n\n\
  \n5 4\n5 3 4 2 1\n2 3 1\n2 1 2\n1 1 3\n2 1 2\n\n\nOutput\n\n\n4\n1\n2\n\n\nInput\n\
  \n\n5 9\n2 3 5 1 4\n2 3 5\n2 5 5\n2 5 1\n2 5 3\n2 5 4\n1 5 4\n2 5 3\n2 2 5\n2 5\
  \ 1\n\n\nOutput\n\n\n3\n5\n4\n2\n3\n3\n3\n1\n\nNote\n\nIn the first example p =\
  \ \\{5, 3, 4, 2, 1\\}. \n\nThe first query is to print p_3. The answer is 4.\n\n\
  The second query is to print p_{p_1}. The answer is 1.\n\nThe third query is to\
  \ swap p_1 and p_3. Now p = \\{4, 3, 5, 2, 1\\}.\n\nThe fourth query is to print\
  \ p_{p_1}. The answer is 2."
